import styled from "styled-components";
import { Link } from "react-router-dom";

export const StyleHeaderContainer = styled.div`
  height: 70px;
  width: 100%;
  display: flex;
  justify-content: space-between;
  margin-bottom: 25px;
  position: relative;
`;

export const StyleLogoContainer = styled(Link)`
  height: 100%;
  width: 70px;
  padding: 10px;
`;

export const StyleOptionsContainer = styled.div`
  width: 50%;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: flex-end;
`;

// export const OptionLink = styled(Link)`
//   padding: 10px 15px;
//   cursor: pointer;

//   &:hover {
//     border-bottom: 1px solid black;
//   }

//   &.${rando} {
//     color: red;
//   }
// `;

const BaseNavItem = styled(Link)`
  padding: 10px 15px;
  cursor: pointer;

  &:hover {
    border-bottom: 1px solid black;
  }
`;

const OptionLink = styled(({ className, ...props }) => (
  <BaseNavItem {...props} activeClassName={className} />
))`
  border-bottom: 1px solid black;
`;

export default OptionLink;
